  [],\n\t\"title\": \"Back-Island Shoreline Points for the Undeveloped Areas of New
  Jersey's Barrier Islands, Extracted from Orthoimagery, March 9, 1991, to July 30,
  2013\",\n\t\"tracking_summary\": {\n\t\t\"total\": 1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2016-03-16T06:31:25.930540\",\n\t\"name\":
  \"back-island-shoreline-points-for-the-undeveloped-areas-of-new-jerseys-barrier-islands-e-30-2013\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Assessing the physical change to shorelines
  and wetlands is critical in determining the resiliency of wetland systems that protect
  adjacent habitat and communities. The wetland and back-barrier shorelines of New
  Jersey changed as a result of wave action and storm surge that occurred during Hurricane
  Sandy, which made landfall on October 29, 2012. The impact of Hurricane Sandy will
  be assessed and placed in its historical context to understand the future vulnerability
  of wetland systems. Making these assessments will rely on data extracted from current
  and historical resources such as maps, aerial photographs, satellite imagery, and
  lidar elevation data, which document physical changes over time. This USGS Data
  Series publication includes several open-ocean shorelines, back-island shorelines,
  back-island shoreline points, sand area polygons, and sand lines for the undeveloped
  areas of New Jersey's barrier islands that were extracted from orthoimagery (orthoaerial
  photography) dated from March 9, 1991 to July 30, 2013. This data-set consists of
  points that were digitized at the intersection of the back-island shoreline and
  a set of transects spaced at 20-meter (m) intervals. The transects, nj_transects_ln_20m_utm18.shp,
  are included in this Data Series publication and can be accessed via the Data Download
  page. Only one back-island shoreline/transect intersection point was digitized per
  transect. Orthoimagery of New Jersey were acquired in digital format from U.S. Department
  of Agriculture (USDA), U.S. Geological Survey (USGS), National Oceanic and Atmospheric
  Administration (NOAA), and New Jersey Geographic Information Network (NJGIN). The
  following list provides additional details about the orthoimagery used. The back-island
  shoreline points are organized by area with all dates for each area compiled into
  one data-set (shapefile) named nj_bshrpt_<range of dates>_<area name>.shp. The orthoimage
  date for each line is included in the shapefile attribute table \"Date_\" field.
  Date Type Source Resolution 19910309-19910313 Pan USGS, DOQQ 1 m (meter) 19950325-19950407
  CIR USGS, DOQQ 1 m 20020218-20020411 CIR NJGIN 1 m* 20060805-20060613 Natural USDA,
  NAIP 1 m 20070318-20070415 Natural NJGIN 1 m* 20080808-20080826 Natural USDA, NAIP
  1 m 20100703-20100726 Natural USDA, NAIP 1 m 20120314-20120416 RGBI NJGIN 1 m* 20121031-20121106
  Natural NOAA 1 m* 20130707-20130730 Natural USDA, NAIP 1 m Pan - Panchromatic (1
  band, gray scale) CIR - Color Infrared (infrared, red, green) Natural - Natural
  Color (red, green, blue) RGBI - Natural Color and Infrared (red, green, blue, and
  infrared) DOQQ - Digital Orthophoto Quarter Quads NAIP - National Agriculture Imagery
  Program *Resampled from 1-foot resolution imagery.\",\n\t\"license_title\": null,\n\t\"extras\":
